  width: 50
  step_time: 0.1
  sample_time: 0.1
  offset: [0, 0]
  control_mode: 'acker'
  collision_mode: 'rvo'
  plot:
    show-title: True
    title: 'Robot World'
    show-axis: True
    x-label: 'X'
    y-label: 'Y'

robot:
