    kinematics: {name: 'omni'}
    shape: {name: 'circle', radius: 0.4}
    state: [1, 1, 0]
    goal: [23, 23, 0]
    behavior: {name: 'rvo'}
    color: 'g'
    sensors:
        - name: 'lidar2d'
          range_min: 1.0
          range_max: 5
          angle_range: 6.0
          number: 50
          noise: True
          alpha: 0.2

